import React from 'react';
import { BrowserRouter as Router, Route, Switch } from 'react-router-dom'
import Nav from './components/Nav'

function App() {
  return (
    <div className="App">
      <Nav />
      <Switch>
        <Route exact path='/'>
        </Route>
      </Switch>
    </div>
  );
}

export default App;
